  "path": "/mi-auto",
  "llave": "Miauto.reserva.ventajas",
  "CL": "<h3 class=\"margin-tb\">Las ventajas de la reserva inmediata</h3>\n  <div class=\"marco-miauto\">\n  <div class=\"flex-between-top margin-top\">\n  <div class=\"ventaja b-5\">\n \n  <b><i class=\"material-icons m-20\">monetization_on</i> M√°s ingresos</b>\n  <p>Los autos con reserva inmediata se arriendan con mayor frecuencia.</p>\n  </div>\n  <div class=\"ventaja b-5\">\n \n  <b><i class=\"material-icons m-20\">verified_user</i> Perfiles de confianza</b>\n  <p>S√≥lo podr√°n arrendar conductores que tengan ciertos niveles de verificaci√≥n.</p>\n  </div>\n  </div>\n \n  <div class=\"flex-between-top margin-top\">\n  <div class=\"ventaja b-5\">\n \n  <b><i class=\"material-icons m-20\">check_circle</i> M√°s f√°cil</b>\n  <p>Preoc√∫pate solo de gestionar las reservas confirmadas. No m√°s solicitudes.</p>\n  </div>\n  <div class=\"ventaja b-5\">\n \n  <b><i class=\"material-icons m-20\">notification_important</i> Elige las reservas que\n  quieres recibir</b>\n  <p>Configura tus preferencias de arriendo y solo recibir√°s reservas que se ajusten a tus\n  condiciones.</p>\n  </div>\n  </div>\n  </div>",
  "MX": "<h3 class=\"margin-tb\">Las ventajas de la reserva inmediata</h3>\n  <div class=\"marco-miauto\">\n  <div class=\"flex-between-top margin-top\">\n  <div class=\"ventaja b-5\">\n \n  <b><i class=\"material-icons m-20\">monetization_on</i> M√°s ingresos</b>\n  <p>Los autos con reserva inmediata se rentan con mayor frecuencia.</p>\n  </div>\n  <div class=\"ventaja b-5\">\n \n  <b><i class=\"material-icons m-20\">verified_user</i> Perfiles de confianza</b>\n  <p>S√≥lo podr√°n rentar conductores que tengan ciertos niveles de verificaci√≥n.</p>\n  </div>\n  </div>\n \n  <div class=\"flex-between-top margin-top\">\n  <div class=\"ventaja b-5\">\n \n  <b><i class=\"material-icons m-20\">check_circle</i> M√°s f√°cil</b>\n  <p>Preoc√∫pate solo de gestionar las reservas confirmadas. No m√°s solicitudes.</p>\n  </div>\n  <div class=\"ventaja b-5\">\n \n  <b><i class=\"material-icons m-20\">notification_important</i> Elige las reservas que\n  quieres recibir</b>\n  <p>Configura tus preferencias de renta y solo recibir√°s reservas que se ajusten a tus\n  condiciones.</p>\n  </div>\n  </div>\n  </div>",
  "US": "<h3 class=\"margin-tb\">The advantages of Instant Booking</h3>\n  <div class=\"marco-miauto\">\n  <div class=\"flex-between-top margin-top\">\n  <div class=\"ventaja b-5\">\n \n  <b><i class=\"material-icons m-20\">monetization_on</i> More incomes</b>\n  <p>Cars with Instant Booking get more bookings.</p>\n  </div>\n  <div class=\"ventaja b-5\">\n \n  <b><i class=\"material-icons m-20\">verified_user</i> Trusted profiles</b>\n  <p>Only drivers with certain verification level will be able to rent.</p>\n  </div>\n  </div>\n \n  <div class=\"flex-between-top margin-top\">\n  <div class=\"ventaja b-5\">\n \n  <b><i class=\"material-icons m-20\">check_circle</i> Easier</b>\n  <p>Only worry about confirmed bookings. No more booking requests.</p>\n  </div>\n  <div class=\"ventaja b-5\">\n \n  <b><i class=\"material-icons m-20\">notification_important</i> Choose the bookings\n  you want to get</b>\n  <p>Set your rental preferences and you will only receive bookings that fit\n  the conditions.</p>\n  </div>\n  </div>\n  </div>"
